(25301, 681, '\r\n			<p style=\"text-align:justify\">Seorang programmer membuat direktori baru untuk proyeknya. Langkah pertama yang harus dia lakukan untuk mulai melacak perubahan di direktori tersebut menggunakan Git adalah menginisialisasi Git di dalamnya. Manakah perintah yang harus digunakan ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25302, 681, '\r\n			<p style=\"text-align:justify\">Dalam sebuah tim proyek, dua anggota tim, Ali dan Budi, bekerja di branch berbeda untuk menambah fitur yang berbeda pula. Ali bekerja di branch feature-A dan Budi di branch feature-B. Apa manfaat utama dari membuat branch terpisah dalam skenario ini ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25303, 681, '\r\n			<p style=\"text-align:justify\">Ketika mencoba menggabungkan branch feature-x ke dalam branch main, seorang developer mendapati konflik pada file index.html. Apa langkah yang benar untuk menyelesaikan konflik ini di Git ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25304, 681, '\r\n			<p style=\"text-align:justify\">Anda ingin mengunduh salinan repository yang ada di GitHub ke komputer lokal Anda agar bisa melakukan pengembangan secara offline. Perintah Git manakah yang harus digunakan untuk mengkloning repository ini ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25305, 681, '\r\n			<p style=\"text-align:justify\">Setelah melakukan beberapa perubahan pada file di project, Anda ingin mengetahui status terbaru dari file yang ada di repository lokal Anda, termasuk file yang belum ditambahkan atau di-commit. Perintah manakah yang digunakan untuk melihat status ini ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25306, 681, '\r\n			<p style=\"text-align:justify\">Di dalam proyek yang sedang dikerjakan, seorang programmer ingin melihat semua commit sebelumnya yang sudah dilakukan di repository untuk melacak riwayat perubahan kode. Perintah Git manakah yang harus digunakan ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25307, 681, '\r\n			<p style=\"text-align:justify\">Seorang developer membuat pesan commit dengan deskripsi: \"fix.\" Menurut prinsip commit message yang baik, mengapa pesan ini kurang tepat ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25308, 681, '\r\n			<p style=\"text-align:justify\">Sebuah tim proyek memilih menggunakan Git untuk mengelola kode sumbernya. Apa keuntungan utama dari penggunaan Git dalam pengembangan proyek kolaboratif ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25309, 681, '\r\n			<p style=\"text-align:justify\">Sebuah tim menemukan konflik ketika melakukan merge branch feature-auth ke dalam main. Apa kemungkinan penyebab utama dari konflik ini ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25310, 681, '\r\n			<p style=\"text-align:justify\">Anda sedang bekerja dalam sebuah tim dan telah membuat perubahan pada kode di branch baru (feature/login). Untuk menyimpan perubahan ke dalam repositori pusat di branch yang sama, perintah Git manakah yang tepat digunakan ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25311, 681, '\r\n			<p style=\"text-align:justify\">Seorang programmer ingin menginstal Laravel di komputernya. Dia telah menginstal PHP versi 7.3.1 dan Composer. Namun, saat menjalankan perintah instalasi Laravel, dia mengalami error yang mengindikasikan bahwa versinya tidak kompatibel. Apa yang perlu dia lakukan untuk memperbaiki masalah ini ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25312, 681, '\r\n			<p style=\"text-align:justify\">Saat menjalankan perintah composer create-project --prefer-dist laravel/laravel project-name, apa yang sebenarnya dilakukan oleh Composer dalam proses ini ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25313, 681, '\r\n			<p style=\"text-align:justify\">Setelah menginstal Laravel, seorang siswa melihat banyak folder dan file di dalam proyeknya. Apa fungsi utama folder routes di dalam struktur Laravel ....</p>\r\n\r\n			<p>&nbsp;</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25314, 681, '\r\n			<p style=\"text-align:justify\">Setelah menginstal Laravel, seorang siswa ingin menjalankan aplikasi Laravel di server lokal. Manakah dari perintah berikut yang benar untuk menjalankan Laravel dengan server bawaan ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25315, 681, '\r\n			<p style=\"text-align:justify\">Seorang developer menjalankan perintah php artisan serve, tetapi terjadi error \"command not found\". Apa langkah pertama yang sebaiknya dilakukan untuk memperbaiki masalah ini ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25316, 681, '\r\n			<p style=\"text-align:justify\">Sebelum menjalankan migrasi di Laravel, konfigurasi database biasanya dilakukan pada file .env. Setelah mengatur database di .env, perintah manakah yang harus dijalankan untuk membuat tabel-tabel yang diperlukan oleh aplikasi ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25317, 681, '\r\n			<p>Apa peran utama dari perintah php artisan dalam proyek Laravel ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25318, 681, '\r\n			<p style=\"text-align:justify\">File .env dalam Laravel sangat penting untuk konfigurasi aplikasi. Apa yang akan terjadi jika file ini tidak ada atau rusak ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25319, 681, '\r\n			<p style=\"text-align:justify\">Siswa ingin membuat tabel baru di database dengan Laravel. Setelah membuat migrasi, apa langkah selanjutnya yang perlu dilakukan untuk memastikan tabel dibuat di database ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25320, 681, '\r\n			<p style=\"text-align:justify\">Mengapa Composer dibutuhkan untuk menginstal Laravel, dan bagaimana Composer membantu dalam pengembangan Laravel ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25321, 681, '\r\n			<p style=\"text-align:justify\">Anda mencoba menginstal Laravel, tetapi terjadi error yang mengatakan bahwa versi PHP tidak kompatibel. Apa solusi yang paling tepat untuk masalah ini ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25322, 681, '\r\n			<p style=\"text-align:justify\">Apa fungsi utama dari perintah php artisan serve dalam pengembangan aplikasi Laravel ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25323, 681, '\r\n			<p style=\"text-align:justify\">Apa fungsi yang digunakan dalam PHP untuk membuat koneksi ke database MySQL ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25324, 681, '\r\n			<p style=\"text-align:justify\">Jika $text = \"Hello, PHP!\", berapa panjang string yang akan dihasilkan oleh fungsi strlen($text); ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25325, 681, '\r\n			<p style=\"text-align:justify\">Jika Anda ingin mengirim data formulir dari halaman HTML ke PHP menggunakan metode POST, bagaimana cara mengambil data dari input bernama \"username\" di PHP ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25326, 681, '\r\n			<p style=\"text-align:justify\">Jika variabel $x = 10 dan $y = 3, maka nilai dari ekspresi $x % $y adalah &hellip;.</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25327, 681, '\r\n			<p style=\"text-align:justify\">Seorang siswa ingin menghapus data pengguna dari tabel users berdasarkan id. Manakah perintah PHP yang benar untuk melakukan penghapusan ini dengan memanfaatkan metode POST untuk keamanan ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25328, 681, '\r\n			<p style=\"text-align:justify\">Seorang siswa ingin membuat form input data baru untuk disimpan dalam tabel users. Dia sudah membuat form HTML dengan metode POST. Perintah PHP manakah yang benar untuk menyimpan data dari form tersebut ke dalam database ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25329, 681, '\r\n			<p style=\"text-align:justify\">Dalam aplikasi berbasis web, seorang siswa ingin menampilkan semua data pengguna dari tabel users pada halaman utama. Manakah dari pernyataan berikut yang benar untuk mengambil semua data dari tabel users menggunakan PHP dan MySQLi ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25330, 681, '\r\n			<p style=\"text-align:justify\">Seorang siswa menggunakan perulangan while dalam PHP untuk menampilkan data dari tabel users. Berikut adalah cuplikan kodenya:</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">$query = mysqli_query($conn, \"SELECT * FROM users\");</p>\r\n\r\n			<p style=\"text-align:justify\">while ($row = mysqli_fetch_assoc($query)) {</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; &nbsp;echo $row[\'name\'];</p>\r\n\r\n			<p style=\"text-align:justify\">}</p>\r\n\r\n			<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n			<p style=\"text-align:justify\">Apa yang akan ditampilkan oleh kode ini ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25331, 681, '\r\n			<p style=\"text-align:justify\">Seorang developer sedang membuat aplikasi untuk pendaftaran ekstrakurikuler di sekolah. Aplikasi ini memiliki fitur CRUD yang memungkinkan siswa untuk mendaftarkan diri, mengubah data pendaftaran mereka, melihat daftar pendaftar, dan membatalkan pendaftaran. Jika Anda ingin membuat fitur untuk menampilkan seluruh data pendaftar ekstrakurikuler, query SQL apa yang akan Anda gunakan dalam PHP ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25332, 681, '\r\n			<p style=\"text-align:justify\">Seorang siswa membuat aplikasi untuk mengelola inventaris buku perpustakaan. Setiap buku memiliki informasi seperti judul, penulis, dan jumlah eksemplar. Aplikasi harus memiliki fitur CRUD sehingga pengguna dapat menambah, melihat, memperbarui, dan menghapus data buku. Seorang pengguna ingin mengedit informasi buku dengan ID tertentu. Dia menggunakan query berikut: UPDATE books SET title=\'$title\', author=\'$author\' WHERE id=\'$id\'. Namun, terkadang perubahan tidak tersimpan dengan benar. Apa kemungkinan penyebabnya ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25333, 681, '\r\n			<p style=\"text-align:justify\">Dalam aplikasi CRUD, manakah yang merupakan fungsi utama dari metode POST dibandingkan metode GET ketika mengirimkan data dari form HTML ke skrip PHP ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25334, 681, '\r\n			<p style=\"text-align:justify\">Sebuah array $students = array(\"Ali\", \"Budi\", \"Cici\");. Manakah pernyataan yang akan menampilkan jumlah elemen dalam array tersebut ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25335, 681, '\r\n			<p>Mengapa penting untuk memiliki primary key (misalnya, kolom id) dalam tabel database ketika membuat aplikasi CRUD ....</p>\r\n			', 2.85, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25336, 677, '\r\n			<p style=\"text-align:justify\">Apa yang paling penting dalam perencanaan pengadaan sarana dan prasarana kantor?</p>\r\n\r\n			<p>&nbsp;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25337, 677, '\r\n			<p>Ketika perusahaan menghadapi masalah ruang kerja yang terbatas, apa yang sebaiknya dilakukan oleh manajer administrasi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25338, 677, '\r\n			<p>Jika perangkat keras komputer di kantor sering mengalami gangguan, apa yang seharusnya menjadi prioritas utama manajer administrasi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25339, 677, '\r\n			<p>Seorang manajer ingin meningkatkan efisiensi kerja dengan digitalisasi proses administrasi. Apa yang harus menjadi fokus utama?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25340, 677, '\r\n			<p>Dalam memilih vendor untuk pengadaan peralatan kantor, faktor apa yang paling menentukan keputusan akhir?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25341, 677, '\r\n			<p>Apa langkah pertama yang harus diambil manajer administrasi ketika karyawan mengeluhkan suhu ruangan yang tidak nyaman?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25342, 677, '\r\n			<p>Manakah dari berikut ini yang merupakan manfaat utama menggunakan cloud storage untuk menyimpan data perusahaan?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25343, 677, '\r\n			<p>Seorang manajer administrasi mendapati bahwa penggunaan kertas di kantor sangat tinggi. Apa yang seharusnya dilakukan untuk mengatasi masalah ini?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25344, 677, '\r\n			<p>Dalam situasi darurat kebakaran di gedung kantor, langkah pertama yang harus diambil oleh staf adalah:</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25345, 677, '\r\n			<p>Ketika perusahaan ingin merampingkan proses administrasi, aspek apa yang harus menjadi fokus utama?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25346, 677, '\r\n			<p>Jika karyawan sering mengeluhkan fasilitas kantor yang rusak, apa yang harus dilakukan oleh manajer administrasi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25347, 677, '\r\n			<p>Ketika inventaris kantor tidak dikelola dengan baik, konsekuensi yang paling mungkin terjadi adalah:</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_poin`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES
(25348, 677, '\r\n			<p>Seorang manajer administrasi menemukan bahwa dokumen penting sering hilang. Apa solusi terbaik untuk masalah ini?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
