(25350, 677, '\r\n			<p>Jika perusahaan mengalami kesulitan dalam pengelolaan arsip fisik, tindakan yang paling efektif adalah:</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25351, 677, '\r\n			<p>Manajer administrasi menemukan bahwa tingkat kepuasan karyawan menurun karena lingkungan kerja yang tidak nyaman. Solusi apa yang dapat diterapkan?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
