(25353, 677, '\r\n			<p>Untuk menjaga keamanan informasi perusahaan, tindakan apa yang paling efektif?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25354, 677, '\r\n			<p>Dalam rangka meningkatkan manajemen waktu, perusahaan memutuskan untuk mengimplementasikan sistem manajemen waktu digital. Apa manfaat utama dari sistem ini?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
