(25356, 677, '\r\n			<p>Jika seorang manajer administrasi mendapati bahwa proses pengadaan barang di kantor terlalu lambat, apa yang harus dilakukan?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
