(25358, 677, '\r\n			<p>Ketika perusahaan ingin meningkatkan keamanan fisik kantor, apa yang harus menjadi fokus utama?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
