(25360, 677, '\r\n			<p>Jika perusahaan ingin meningkatkan kepuasan pelanggan melalui layanan administrasi, tindakan apa yang paling efektif?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25361, 677, '\r\n			<p>Dalam menjaga kelancaran operasional kantor, faktor apa yang harus selalu diprioritaskan oleh manajer administrasi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
