(25368, 677, '\r\n			<p>Ketika perusahaan memutuskan untuk memperbarui peralatan kantor, faktor apa yang paling penting untuk dipertimbangkan?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
