(25853, 676, '\r\n			<p>Sehari sebelum kemerdekaan bangsa Indonesia, tanggal 16 Agustus 1945, golongan muda menculik Ir. Soekarno dan Drs. Moh. Hatta untuk mendesak agar segera melaksanakan pembacaan proklamasi dan mengumumkan kemerdekaan Indonesia yang diakibatkan adanya kekosongan kekuasaan oleh pemerintahan Jepang di Indonesia. Tempat golongan muda membawa golongan tua adalah....</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25854, 676, '\r\n			<p>Peristiwa pembacaan teks proklamasi menjadi momen bersejarah sampai saat ini yang harus diabadikan. Pembuatan naskahnya pun tidak sembarangan dan sudah melalui pemikiran matang serta disahkan. Naskah Proklamasi otentik atau resmi yaitu....</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25855, 676, '\r\n			<p>Pada saat peristiwa proklamasi, Moh Hatta memberikan kesaksian terhadap reaksinya akan kejadian penculikan golongan tua oleh golongan muda yang berbunyu, &ldquo;Jauh daripada suatu kemenangan dari pemuda, penculikan Soekarno dan Hatta ke Rengasdengklok dan kembalinya hari itu juga ke Jakarta merupakan suatu pembuktian kepada sejarah daripada bangkrutnya suatu politik dengan tiada perhitungan, nan semata-mata berdasar sentimen. Pernyataan pula daripada politik tidak mampu! Karena penculikan itulah maka proklamasi Indonesia nan semula akan berlangsung pada tanggal 16 Agustus, menjadi terlambat satu hari.&rdquo; (Mohammad Hatta, Sekitar Proklamasi).</p>\r\n\r\n			<p>Di dalam kesaksian Hatta tersebut, peristiwa Rengasdengklok menurut golongan tua dianggap sebaga</p>\r\n\r\n			<p>&nbsp;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
