(25920, 689, '\r\n			<p>Bacalah teks prosedur di bawah ini.</p>\r\n\r\n			<p>1. Klik menu start pada layar desktop anda.</p>\r\n\r\n			<p>2. Pastikan semua program aktif komputer Anda telah dimatikan.</p>\r\n\r\n			<p>3. Setelah itu, pilih opsi Shutdown.</p>\r\n\r\n			<p>4. Cabut semua kabel yang terhubung ke listrik.</p>\r\n\r\n			<p>5. Tunggu hingga komputer benar-benar mati.</p>\r\n\r\n			<p>Berdasarkan teks di atas, urutan langkah mematikan komputer yang benar adalah&hellip;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25921, 689, '\r\n			<p>Bacalah teks prosedur berikut dengan cermat untuk menjawab soal nomor 4 dan 5.</p>\r\n\r\n			<p>Pertolongan Pertama pada Luka Bakar Ringan.</p>\r\n\r\n			<p>Cedera akibat luka bakar ringan dapat terjadi di mana saja. Jika bukan Anda yang mengalaminya, bisa jadi Anda merupakan orang terdekat yang dapat menolong korban. Umumnya, penanganan atas luka bakar ringan dapat Anda lakukan sendiri tanpa harus ke dokter.</p>\r\n\r\n			<p>Berikut adalah langkah-langkah yang dapat Anda lakukan saat memberikan pertolongan pertama pada luka bakar ringan.</p>\r\n\r\n			<p>1. Kompres luka dengan handuk yang telah dibasahi oleh air dingin untuk meredakan rasa nyeri dan panas.</p>\r\n\r\n			<p>2. Hindari memecahkan luka yang melepuh karena berisiko infeksi.</p>\r\n\r\n			<p>3. Jika ada luka lepuh yang pecah dengan sendirinya, cuci dengan air bersih mengalir.</p>\r\n\r\n			<p>4. Oleskan salep antibiotik untuk mencegah terjadinya infeksi, kemudian segera tutup luka dengan perban. Pastikan perban yang digunakan adalah perban anti lengket agar kulit yang luka tidak menempel saat perban dibuka.</p>\r\n\r\n			<p>5. Jika rasa sakit terasa tidak tertahankan penderita dapat mengonsumsi obat anti nyeri.</p>\r\n\r\n			<p>Demikian langkah-langkah pertolongan pertama pada luka bakar ringan yang dapat Anda lakukan.</p>\r\n\r\n			<p>Berikut pernyataan yang sesuai dengan isi teks prosedur tersebut adalah&hellip;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
