(25927, 689, '\r\n			<p>Bacalah teks ceramah berikut dengan saksama.</p>\r\n\r\n			<p>Hadirin sekalian.</p>\r\n\r\n			<p>Jadi, berapa takaran normal air agar tubuh kita tidak kekurangan cairan? Sebenarnya, kebutuhan cairan tiap orang berbeda-beda. Untuk orang dewasa, konsumsi air putih yang disarankan adalah sekitar delapan gelas berukuran 230 ml per hari atau setara dengan dua liter. Namun, cairan tersebut tidak hanya dapat diperoleh dari minuman. Makanan, terutama buah dan sayur, juga memberikan asupan cairan pada tubuh sekitar 20%.</p>\r\n\r\n			<p>Topik yang diangkat dalam teks ceramah tersebut adalah&hellip;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25928, 689, '\r\n			<p>Bacalah kutipan teks resensi berikut.</p>\r\n\r\n			<p>Berdasarkan kelemahan dan kelebihannya, novel ini sangat disarankan bagi pembaca usia remaja yang menyukai cerita dengan latar belakang sejarah, persoalan hukum, sebuah penyelidikan, dan tentunya penjelajahan yang dibumbui kisah percintaan sederhana. Akan tetapi, novel ini tidak disarankan dibaca oleh anak-anak sebab ada beberapa bagian cerita yang menggambarkan kekerasan. Novel setebal 500 halaman ini juga akan melelahkan jika dibaca oleh anak-anak.</p>\r\n\r\n			<p>Kutipan teks tersebut merupakan struktur teks resensi bagian&hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25929, 689, '\r\n			<p>Bacalah teks berikut.</p>\r\n\r\n			<p>Oleh karena cerita ini berlatar daerah terpencil, ada beberapa bahasa yang tidak dimengerti oleh para pembaca. Jadi, hal tersebut membuat pembaca sulit memahami maksud cerita yang disajikan.</p>\r\n\r\n			<p>Unsur yang dijelaskan dalam teks tersebut adalah&hellip;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25930, 689, '\r\n			<p>1Bacalah teks berikut.</p>\r\n\r\n			<p>(1)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Buku antologi puisi ini memuat 24 sajak yang ditulis pada pertengahan dekade 1970-an, yakni saat orde baru berada pada puncak kejayaannya. (2) Pada masa itu, banyak sarana dan prasarana dibangun di kota-kota besar. (3) Sebagian kelompok yang menikmati proses pembangunan itu, seperti pejabat dan keluarganya banyak&nbsp; yang mendadak kaya raya. (4) Gaya hidup mereka hedonis. (5) Sementara itu, sebagian kelompok yang lain justru tertinggal, tergusur dan terpinggirkan.</p>\r\n\r\n			<p>Kalimat yang mengandung konjungsi pertentangan adalah kalimat nomor&hellip;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25931, 689, '\r\n			<p>Bacalah teks berikut untuk menjawab soal nomor 14 dan 15.</p>\r\n\r\n			<p>Kering merupakan novel karya Iwan Simatupang yang diterbitkan oleh Gunung Agung pada tahun 1972. Novel Kering bercerita tentang tokoh kita yang ikut ke dalam kelompok orang-orang yang bertransmigrasi. Usaha para transmigrant di tempat tujuannya itu tidak dapat berjalan dengan baik karena tanah yang akan digarap sebagai lahan pertanian retak-retak akibat musim kemarau yang panjang. (&hellip;.) menemukan daerah lembah yang berair, tokoh kita akhirnya membangun kota musim kemarau. (&hellip;.) ketika pembangunan kota itu hampir selesai, musim hujan tiba dan awan hitam pun bergulung-gulung di udara. Kota yang dibangun oleh tokoh kita hancur berantakan karena diterpa badai angin dan hujan.</p>\r\n\r\n			<p>Pesan yang terkandung dalam novel ini adalah kita tidak dapat meraih sesuatu yang belum datang dan kita tidak dapat menolak sesuatu yang datang.</p>\r\n\r\n			<p>Konjungsi yang tepat untuk mengisi bagian yang rumpang adalah&hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25932, 689, '\r\n			<p>Bacalah teks berikut untuk menjawab soal nomor 14 dan 15.</p>\r\n\r\n			<p>Kering merupakan novel karya Iwan Simatupang yang diterbitkan oleh Gunung Agung pada tahun 1972. Novel Kering bercerita tentang tokoh kita yang ikut ke dalam kelompok orang-orang yang bertransmigrasi. Usaha para transmigrant di tempat tujuannya itu tidak dapat berjalan dengan baik karena tanah yang akan digarap sebagai lahan pertanian retak-retak akibat musim kemarau yang panjang. (&hellip;.) menemukan daerah lembah yang berair, tokoh kita akhirnya membangun kota musim kemarau. (&hellip;.) ketika pembangunan kota itu hampir selesai, musim hujan tiba dan awan hitam pun bergulung-gulung di udara. Kota yang dibangun oleh tokoh kita hancur berantakan karena diterpa badai angin dan hujan.</p>\r\n\r\n			<p>Pesan yang terkandung dalam novel ini adalah kita tidak dapat meraih sesuatu yang belum datang dan kita tidak dapat menolak sesuatu yang datang.</p>\r\n\r\n			<p style=\"text-align:justify\">Identitas buku yang tidak terdapat pada teks tersebut adalah&hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25933, 689, '\r\n			<p>Bacalah teks berikut dengan saksama.</p>\r\n\r\n			<p>Marilah kita curahkan rasa syukur kepada Tuhan Yang Maha Esa atas nikmat yang telah diberikan sehingga kita dapat melaksanakan upacara dengan khidmat dan semangat. Pada kesempatan ini, Bapak akan memberikan sepotong petuah kepada kalian.</p>\r\n\r\n			<p>Teks tersebut termasuk struktur bagian&hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25934, 689, '\r\n			<p>Bacalah teks berikut dengan saksama.</p>\r\n\r\n			<p>Kalian adalah bagian dari estafet kepemimpinan masa depan. Oleh karena itu, kalian memiliki hak yang sama untuk tumbuh, berkembang, dan mewujudkan cita-cita. Mari kita saling menjaga dan menguatkan agar dapat mencapai tujuan bersama. Bapak ingin sekolah kita menjadi tempat yang menyenangkan bagi kalian. Budayakan cinta damai dan hindari segala macam bentuk perundungan di sekolah.</p>\r\n\r\n			<p>Permasalahan yang dibahas dalam kutipan teks tersebut adalah&hellip;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
