(25949, 689, '\r\n			<p>Cermati unsur-unsur berikut.</p>\r\n\r\n			<p>1. Judul resensi</p>\r\n\r\n			<p>2. Identitas penerbit</p>\r\n\r\n			<p>3. Sinopsis buku</p>\r\n\r\n			<p>4. Latar belakang resensi</p>\r\n\r\n			<p>5. Keunggulan buku</p>\r\n\r\n			<p>6. Kelemahan buku</p>\r\n\r\n			<p>Unsur-unsur teks resensi buku ditunjukkan nomor&hellip;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25950, 689, '\r\n			<p>Bacalah teks resensi berikut.</p>\r\n\r\n			<p>Secara keseluruhan, buku latihan soal Mantappu Jiwa sangat menarik. Alur cerita yang rapi memudahkan pembaca mengenal Jerome melalui kisah-kisahnya. Ilustrasi dan halaman yang berwarna-warni juga sangat memanjakan mata.</p>\r\n\r\n			<p>Buku ini dapat dibaca oleh semua kalangan, terutama para pelajar, karena dapat memotivasi untuk tidak menyerah dalam mengejar mimpi.</p>\r\n\r\n			<p>Berdasarkan teks tersebut, keunggulan buku latihan soal Mantappu Jiwa adalah&hellip;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25951, 689, '\r\n			<p>Struktur teks resensi yang tepat adalah&hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25952, 689, '\r\n			<p>Bacalah teks resensi berikut.</p>\r\n\r\n			<p>Secara keseluruhan, buku ini layak dibaca oleh seluruh Masyarakat Indonesia agar lebih memahami dan peduli terhadap kehidupan nelayan, laut, dan kebudayaan Bahari langka.</p>\r\n\r\n			<p>Kutipan teks tersebut merupakan struktur teks resensi bagian&hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25953, 689, '\r\n			<p>Berikut yang bukan kaidah kebahasaan teks resensi adalah&hellip;..</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25954, 689, '\r\n			<p>Bacalah teks di bawah ini untuk menjawab soal</p>\r\n\r\n			<p>Meskipun puisi-puisi di dalam buku ini dibuat empat decade lalu, isu-isunya masih tetap relevan dengan situasi terkini. Sepertinya cerita politik ini tidak pernah mati dan Rendra tidak pernah pergi. Ia tetap hidup dalam Sejarah Indonesia Ketika kata-kata dalam sajak-sajaknya mengilhami Gerakan kemanusiaan dan kebudayaan.</p>\r\n\r\n			<p>Konjungsi pertentangan yang terdapat dalam kutipan tersebut adalah&hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25955, 689, '\r\n			<p>Berikut kalimat yang tidak menggunakan kata kerja mental adalah&hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25956, 689, '\r\n			<p>Berikut yang tidak termasuk kaidah kebahasaan teks ceramah adalah&hellip;</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25957, 689, '\r\n			<p>Ceramah yang bertujuan menyampaikan pendapat atau pandangan disertai alasan logis termasuk kedalam jenis ceramah&hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25993, 670, '\r\n			<p style=\"text-align:justify\">Ananda membeli sebuah mobil dengan cara kredit. Setiap bulannya, ananda membayar angsuran yang besarnya tetap. Sistem pembayaran tersebut adalah &hellip;.</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25994, 670, '\r\n			<p style=\"text-align:justify\">Pengertian Bunga Majemuk adalah &hellip;.</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25995, 670, '\r\n			<p style=\"text-align:justify\">Sinta&nbsp;meminjam uang dari koperasi sebesar Rp 750.000,00. Dengan bunga tunggal sebesar 2% setiap bulan. Besar bunga yang harus dibayar setelah&nbsp;&nbsp;6 bulan adalah&hellip;..</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25996, 670, '\r\n			<p style=\"text-align:justify\">Rian&nbsp;menabung di bank sebesar Rp.&nbsp;2.000.000,00 dengan suku bunga tunggal 6% pertahun. Pada saat diambil uang Ali menjadi Rp.&nbsp;2.080.000,00. Lama Rian&nbsp;menabung adalah &hellip;.</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25997, 670, '\r\n			<p style=\"text-align:justify\">Seorang investor ingin mencapai jumlah akhir sebesar Rp&nbsp;500.000,00&nbsp;dari investasi bunga majemuk tahunan dalam waktu 5 tahun. Jika suku bunga tahunan yang diterapkan adalah 8%, maka&nbsp;besar modal awal yang perlu diinvestasikan&nbsp;adalah &hellip;.</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25998, 670, '\r\n			<p style=\"text-align:justify\">Seorang investor menyimpan modal sebesar Rp12.000.000,00&nbsp;di sebuah rekening tabungan dengan bunga majemuk tahunan. Setelah 3 tahun modal tersebut berkembang menjadi Rp14.000.000,00.&nbsp;Besar suku bunga tahunan yang diterapkan pada investasi tersebut&nbsp;dan bulatkan&nbsp;hasilnya ke angka terdekat&nbsp;adalah &hellip;.</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(25999, 670, '\r\n			<p style=\"text-align:justify\">Suatu pinjaman akan di lunasin dengan sistem anuitas bulanan jika besar anuitas RP. 1.000.000,00 maka Tentukanlah angsuran ke 2 jika bunga ke-2 sebesar Rp. 400.000,00&nbsp;adalah &nbsp;. . .</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26000, 670, '\r\n			<p style=\"text-align:justify\">Matriks yang mengalami pertukaran elemen dari kolom menjadi baris atau sebaliknya disebut.&hellip;</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26001, 670, '\r\n			<p style=\"text-align:justify\">Perhatikan matriks di bawah ini, ordo matriks A adalah &hellip;.</p>\r\n\r\n			<p style=\"text-align:justify\"><strong><strong><img src=\"file:///C:\\Users\\ASUS\\AppData\\Local\\Temp\\ksohtml11960\\wps1.jpg\" style=\"height:105px; width:248px\"></strong></strong></p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26020, 699, '\r\n			<p>Tari Topeng Betawi dikenal memiliki karakteristik gerakan yang unik. Salah satu unsur penting dalam Tari Topeng Betawi adalah ekspresi wajah penarinya yang menggambarkan karakter tertentu. Menurut Anda, bagaimana pengaruh ekspresi wajah penari terhadap penonton dalam penyampaian cerita tari tersebut?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26021, 699, '\r\n			<p>Tari Lenggang Nyai merupakan salah satu tari kreasi Betawi yang menggambarkan semangat seorang perempuan Betawi. Tari ini biasanya diiringi oleh musik tradisional Betawi. Mengapa penggunaan musik tradisional menjadi hal yang sangat penting dalam pertunjukan Tari Lenggang Nyai?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26022, 699, '\r\n			<p>Seni Tari Betawi sering kali menampilkan gerakan yang dinamis dan energik. Jika Anda dihadapkan pada situasi di mana Anda harus menciptakan sebuah tari kreasi baru berdasarkan gerakan-gerakan tradisional Betawi, bagaimana cara Anda mengintegrasikan elemen modern tanpa menghilangkan identitas budaya tradisionalnya?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26023, 699, '\r\n			<p>Tari Yapong sering kali diasosiasikan dengan perayaan-perayaan tertentu di masyarakat Betawi. Menurut Anda, apa peran Tari Yapong dalam menjaga identitas budaya masyarakat Betawi di era modern ini?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26024, 699, '\r\n			<p>Beberapa tari tradisional Betawi sering menggunakan kostum dengan warna-warna mencolok. Bagaimana penggunaan warna dalam kostum tari dapat mempengaruhi pesan yang ingin disampaikan oleh sebuah pertunjukan tari?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26025, 699, '\r\n			<p>Tari Topeng Betawi memiliki karakteristik gerakan dan ekspresi yang mencolok. Bagaimana penari menggunakan ekspresi wajah untuk memperkuat karakter dalam tarian?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26026, 699, '\r\n			<p>Mengapa Tari Lenggang Nyai menggunakan iringan musik tradisional Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26027, 699, '\r\n			<p>Salah satu ciri khas dari Tari Ondel-Ondel adalah gerakan yang berirama dan menggunakan boneka besar. Apa makna dari penggunaan boneka besar dalam tarian ini?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26028, 699, '\r\n			<p>Tari Cokek adalah salah satu tarian tradisional Betawi yang dikenal dengan gerakan yang enerjik dan kostum yang menarik. Bagaimana Tari Cokek mencerminkan interaksi budaya antara Betawi dan komunitas lain di sekitarnya?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0);
INSERT INTO `cbt_soal` (`soal_id`, `soal_topik_id`, `soal_detail`, `soal_poin`, `soal_tipe`, `soal_kunci`, `soal_difficulty`, `soal_aktif`, `soal_audio`, `soal_audio_play`, `soal_timer`, `soal_inline_answers`, `soal_auto_next`) VALUES
(26029, 699, '\r\n			<p>Rumah adat Betawi memiliki banyak ventilasi. Apa manfaat utama dari desain ini?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26030, 699, '\r\n			<p>Apa fungsi utama dari teras luas pada rumah adat Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26031, 699, '\r\n			<p>Apa yang menjadi ciri khas dari Rumah Kebaya dalam arsitektur Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26032, 699, '\r\n			<p>Mengapa material kayu banyak digunakan dalam pembangunan rumah tradisional Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26033, 699, '\r\n			<p>Mengapa warna-warna cerah sering digunakan dalam rumah adat Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26034, 699, '\r\n			<p>Upaya pelestarian arsitektur Betawi termasuk dalam kegiatan berikut, kecuali &hellip;.</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26035, 699, '\r\n			<p>Material apa yang sering digunakan dalam konstruksi rumah Betawi ?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26036, 699, '\r\n			<p>Bagaimana cara tari Betawi dapat berkontribusi pada pariwisata lokal?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26037, 699, '\r\n			<p>Apa yang dapat dilakukan untuk meningkatkan apresiasi terhadap tari Betawi di kalangan generasi muda?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26038, 699, '\r\n			<p>Mengapa rumah Betawi tradisional umumnya menggunakan kayu sebagai bahan utama konstruksi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26039, 699, '\r\n			<p>Mengapa kebanyakan rumah Betawi memiliki bentuk panggung?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26040, 699, '\r\n			<p>Kehadiran ornamen gigi balang pada atap rumah Betawi memiliki fungsi sebagai apa?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26041, 699, '\r\n			<p>Kenapa rumah Betawi umumnya memiliki tiga bagian ruang utama: ruang depan, ruang tengah, dan ruang belakang?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26042, 699, '\r\n			<p>Tari Topeng Betawi sering kali menampilkan berbagai karakter dengan ekspresi dan gerakan yang khas. Apa yang menjadi tujuan utama dari penggunaan topeng dalam tarian ini?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26043, 699, '\r\n			<p>Tari Sirih Kuning sering ditampilkan pada acara pernikahan adat Betawi. Apa makna utama dari tarian ini?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26044, 699, '\r\n			<p>Mengapa penting untuk menampilkan Tari Betawi di festival budaya internasional?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26045, 699, '\r\n			<p>Mengapa rumah Betawi tradisional memiliki atap yang tinggi dan miring?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26046, 699, '\r\n			<p>Apa manfaat utama dari penggunaan material lokal seperti kayu dan bambu dalam pembangunan rumah Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26047, 699, '\r\n			<p>Jika rumah Betawi tidak memiliki ventilasi yang cukup, apa dampak utamanya pada kenyamanan penghuni?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26048, 699, '\r\n			<p>Apa yang membedakan rumah Betawi tipe Kebaya dari tipe Gudang?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26049, 699, '\r\n			<p>Apa yang menjadi inspirasi utama dari ornamen flora dan fauna pada rumah Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26050, 699, '\r\n			<p>Apa pengaruh arsitektur modern terhadap keberlangsungan rumah tradisional Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26051, 699, '\r\n			<p>Bagaimana desain rumah Betawi yang terbuka memengaruhi interaksi sosial di lingkungan sekitarnya?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26052, 699, '\r\n			<p>Apa peran dari \"pendopo\" dalam arsitektur rumah Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26053, 699, '\r\n			<p>Elemen arsitektur apa yang mencerminkan pengaruh budaya Tionghoa dalam rumah Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26054, 699, '\r\n			<p>Apa saja bahan utama yang digunakan dalam pembangunan rumah tradisional Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26055, 699, '\r\n			<p>Dalam tari tradisional Betawi, salah satu tarian yang menggambarkan kehidupan sosial masyarakat Betawi adalah Tari Topeng Betawi. Apa yang menjadi ciri khas dari Tari Topeng Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26056, 699, '\r\n			<p>Apa fungsi dari Tari Yapong dalam masyarakat Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26057, 699, '\r\n			<p>Salah satu elemen penting dalam tari tradisional Betawi adalah musik pengiring. Alat musik apa yang umum digunakan dalam tari Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26058, 699, '\r\n			<p>Apa makna simbolis dari warna-warna cerah yang sering digunakan dalam kostum tari Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26059, 699, '\r\n			<p>Dalam tari tradisional Betawi, salah satu tarian yang menggambarkan kehidupan sosial masyarakat Betawi adalah Tari Topeng Betawi. Apa yang menjadi ciri khas dari Tari Topeng Betawi?</p>\r\n			', 2.50, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26060, 700, '\r\n			<p>Perhatikan Gambar di bawah ini, manakah yang menunjukan Sel Neutrofil Segmen...</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26061, 700, '\r\n			<p>Dibawah ini Rumus yang digunakan untuk mengetahui berapa jumlah Faktor Pengenceran yang akan digunakan untuk pemeriksaan jumlah Lekosit adalah&hellip;</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(26062, 700, '\r\n			<p>Perhatikan Gambar di bawah ini, manakah yang menunjukan Sel Monosit...</p>\r\n			', 3.00, 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
